def is_palindrome(string: str) -> bool:
    """ Check if a given string is a palindrome.
    >>> is_palindrome('abba')
    True
    """
    return string == string[::-1]

def is_pangram(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) == set('abcdefghijklmnopqrstuvwxyz')

def is_pangram_2(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram_2('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) >= set('abcdefghijklmnopqrstuvwxyz')

def is_pangram_3(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram_3('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) <= set('abcdefghijklmnopqrstuvwxyz')

def is_pangram_4(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram_4('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) in set('abcdefghijklmnopqrstuvwxyz')

def is_pangram_5(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram_5('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) in set('abcdefghijklmnopqrstuvwxyz')

def is_pangram_6(string: str) -> bool:
    """ Check if a given string is a pangram.
    >>> is_pangram_6('The quick brown fox jumps over the lazy dog')
    True
    """
    return set(string.lower()) in set('abcdefghijklmnopqrstuvwxyz')

